@Political ridicule Ефремова использовали, играя на его недостатках. И я имею ввиду не только алкоголь.
А сейчас разыгрывают карту — аварию. Киселёвы-соловьёвы, т.е. так званные патриЁты,  играют на два паса с навальнятами: одни — патриЁты— намеренно оскорбляют Ефремова, а не спокойно говорят о фактах, т.е. моральный облик, а значит  понимание Ефремова таково, что он не имеет право рассуждать о государственных делах. Они же истошно вопят. А навальные, используя вопль патриЁтов, вопят в свою очередь: система травит человека! И выходит, что сама авария остаётся на втором плане и то, кто такой Ефремов реально остается на втором плане.
Все нагнетают эмоции намеренно.

